import { RouterLink } from 'vue-router';

<template>
    <header></header>
    <main>
        <div class="top_container">
        <div class="top_div">
            <!-- 图标 -->
            <div class="icon_div">
                <img src="@/image/img_bg/aby_icon.png" alt="">
            </div>

            <div class="left_div">
                <!-- 欢迎语 -->
                <div class="welcome_div">
                    <a th:if="${session.member}">
                        <span th:text="${session.member.getEmail()}+'Welcome to AbyBlog!'"></span>
                    </a>
                    <a th:unless="${session.member}">Welcome to AbyBlog!</a>
                </div>

                <!-- 登入登出 -->
                <div class="account_div">
                    <div>
                        <a th:if="${session.member}">
                            <router-link to="/index/toLogout">Sign Out</router-link>
                            <!-- <router-link to="/index/toRegister">Sign Up</router-link> -->
                            <router-link to="/admin/toAdminLogin">Sign In as Admin</router-link>
                        </a>
                        <a th:unless="${session.member}">
                            <router-link to="/index/toLogin">Sign In</router-link>
                            <!-- <router-link to="/index/toRegister">Sign Up</router-link> -->
                            <router-link to="/admin/toAdminLogin">Sign In as Admin</router-link>
                        </a>
                    </div>
                </div>
            </div>

            <!-- 功能键 -->
            <div class="function_div">
                <div class="each_function">
                    <img src="/image/icon/icons8-account-30.png" alt="">
                    <router-link to="/account" style="text-decoration:none;">Account</router-link>
                </div>
                <div class="each_function">
                    <img src="/image/icon/icons8-order-48.png" alt="">
                    <router-link to="/order/showorder" style="text-decoration:none;">Order</router-link>
                </div>
                <div class="each_function">
                    <img src="/image/icon/icons8-cart-30.png" alt="">
                    <router-link to="/cart/showcart" style="text-decoration:none;">Cart</router-link>
                </div>
                <div class="each_function">
                    <img src="@!/image/icon/icons8-star-30.png" alt="">
                    <router-link to="/collect/showcollect" style="text-decoration:none;">Collection</router-link>
                </div>
            </div>

            <!-- 分页栏 -->
            <div class="page_div">
                <div class="each_page">
                    <router-link to="/Home">Home</router-link>
                </div>
                <div class="each_page">
                    <router-link to="/Library">Library</router-link>
                </div>
                <div class="each_page">
                    <router-link to="/Store">Store</router-link>
                </div>
                <div class="each_page">
                    <router-link to="/Forum">Forum</router-link>
                </div>
                <div class="each_page">
                    <router-link to="/Inspiration">Inspiration</router-link>
                </div>
                <div class="each_page">
                    <router-link to="/About">About Aby</router-link>
                </div>
            </div>
        </div>
    </div>
    </main>
</template>

<style scoped>
body {
    width: 100%;
    display: flex;

    align-items: center;
    justify-content: center;
}
p, a, span {
    font-family: frutiger, sans-serif;
}

.top_container {
    position: fixed;
    top: 0;
    left: 0;
    border: 0;

    width: 100%;
    height: 140px;

    background: #31384f;

    z-index: 101;
}
.top_div {
    position: relative;
    margin: 0 auto;

    width: 1200px;
    height: 140px;

    background: #31384f;
}
/* 图标 */
.icon_div {
    float: left;

    width:150px;
    height:100px;
}
.icon_div img{
    height: 100px;
}
/* 欢迎语,登入登出栏-总div */
.left_div {
    float: left;

    width: 650px;
    height: 100px;
}
/* 欢迎语 */
.welcome_div {
    float: left;

    width: 650px;
    height:60px;
    margin-left: 20px;
}
.welcome_div a {
    text-align:left;
    line-height: 60px;

    color: #f84f52;
    font-size: 20px;
    font-weight: bolder;

    text-decoration: none;
}
/* 登入登出栏 */
.account_div {
    float: left;

    height:40px;
}
.account_div a {
    margin-left: 12px;

    font-size: 15px;
    text-align:left;
    line-height: 40px;

    text-decoration:none;
    color: #ffffff;
}
.account_div a:link {
    color: #ffffff;
}
.account_div a:hover {
    color: #f84f52;
}
/* .account_div a:visited {
    color: #ffffff;
} */

/* 功能键 */
.function_div {
    display: flex;
    justify-content: flex-start;

    float: right;

    width:400px;
    height:64px;
}
.function_div .each_function {
    display: flex;
    flex-flow: column;
    align-items: center;
    justify-content: center;

    float: right;
    
    width:100px;
    height:64px;

    text-align: center;

    border-left: 1px solid #706e6f;

    cursor: pointer;
    transition: background-color 0.3s;
}
.function_div .each_function:hover {
    background-color: #f84f52;
}
.function_div .each_function img{
    height: 30px;
}
.function_div .each_function a {
    margin-top: 2px;
    font-size: 15px;
    /* font-weight: bold; */
    text-align:right;

    text-decoration:none;
    color: #ffffff;
}
.function_div .each_function a:link {
    color: #ffffff;
}
/* .function_div .each_function a:hover {
    color: #f84f52;
} */
/* .td_function .each_function a:visited {
    color: #ffffff;
} */

/* 分页栏 */
.page_div {
    display: flex;
    flex-flow: row;
    align-items: center;
    justify-content: center;

    float: left;

    background-color: #ffffff;

    width: 1200px;
    height: 36px;

    /* border-bottom:#31384f solid 2px; */
    border-radius: 36px;
    border: 2px solid #D4D4D4;
}
.each_page {
    width: auto;
    height: 36px;

    margin: 0 20px;
    padding: 0 16px;

    line-height: 36px;
    text-align: center;

    cursor: pointer;
    transition: all 0.3s;

    border-radius: 36px;
}
.each_page:hover {
    box-shadow:
        inset -2px -2px 4px rgba(255, 255, 255, .9),
        inset 2px 2px 4px rgba(0, 0, 0, .4);
}
.each_page a {
    color: #31384f;

    font-size: 16px;
    font-weight: bold;
    text-decoration: none;
}
.each_page a:link {
    color: #31384f;
}
/* .each_page a:hover {
    color: #f84f52;
} */
.each_page a:visited {
    color: #31384f;
}

/*
构成主义 1 >
#EAE3CB 乳白色
#160A0A 咖啡黑色
#F05D06 橙色

构成主义 2 >
#EEE9D6 乳白色
#160A0A 咖啡黑色
#F9823E 橙色

其他配色 >
#120F11 藏蓝色

简约 >
#31384f 藏蓝色
#fec738 黄色
#b2b2b2 浅灰
#706e6f 深灰
#e7e5e1 鹅毛灰色-背景板
*/
</style>
